import React from 'react';
import { Link } from 'react-router-dom';

function NavigationBar() {
  let authuser = sessionStorage.getItem('Key_Veriable')
  //console.log(authuser)
  if (authuser === 'ADMIN') {
    return (

      <nav>
        <b className="nav">
              <Link className="navi"  to="/adminafterlogin">Admin Home </Link>
              <Link className="navi" to="/reg">Register Student</Link> 
              <Link className="navi" to="/viewall">Show Students </Link>
              <Link className="navi" to="/search">Search </Link> 
              <Link className="navi" to="/logout">Logout </Link>
        </b>
      </nav>
    )

  }
  else if (authuser === 'USER') {

  }
  else {
    return (
      <nav>
        <b className="nav">
          <Link className="navi" to="/">HOME </Link> 
              
              <Link className="navi" to="/login">Login </Link> 
              <Link className="navi" to="/about">About Us </Link> 
              <Link className="navi" to="/contact">Contact Us </Link> 
              <Link className="navi" to="/adminlogin">Admin Login</Link>
        </b>
      </nav>
    )
  }
}

export default NavigationBar
